Here are the resulting steps in the ChIP-Seq Workflow pipeline. There might be slight alterations in the actual implementation, which can be found in the St. Jude Cloud workflows repository . Run picard ValidateSam on the incoming BAM to ensure that it is well-formed enough to convert back to FastQ. picard ValidateSamFile I=$INPUT_BAM \ # Input BAM. IGNORE=INVALID_PLATFORM_VALUE \ # Validations to ignore. IGNORE=MISSING_PLATFORM_VALUE Split BAM file into multiple BAMs on the different read groups using samtools split. See the samtools documentation for more information. samtools split -u $UNACCOUNTED_BAM_NAME \ # Reads that do not belong to a read group or the read group is unrecognized go here. -f '%*_%!.%.' # Format of output BAM file names. If the BAM has unaccounted reads, those reads will need to be removed and the samtools split step will need to be rerun. Run Picard SamToFastq on each of the BAMs generated in the previous step. picard SamToFastq \ INPUT=$INPUT_BAM \ FASTQ=$FASTQ_R1 \ SECOND_END_FASTQ=$FASTQ_R2 \ RE_REVERSE=true \ VALIDATION_STRINGENCY=SILENT Run fq lint on each of the FastQ pairs generated in the previous step as a quality check. You can see the checks that the fq tool performs here . fq lint $FASTQ_R1 $FASTQ_R2 # Files for read 1 and read 2. Run the BWA alignment algorithm. bwa aln $INDEX_PREFIX \ $ALL_FASTQ_R1 $ALL_FASTQ_READ2 \ # FastQ files, separated by comma if there are multiple files. The order of your R1 and R2 files must match! # For single end data
bwa samse \ $INDEX_PREFIX \ $SAI \ $ALL_FASTQ_R1 | samtools view -hb --threads ${ncpu} -o $BWA_BAM # For paired end data
bwa sampe \ $INDEX_PREFIX \ $SAI_R1 \ $SAI_R2 \ $ALL_FASTQ_R1 \ $ALL_FASTQ_READ2 | samtools view -hb --threads ${ncpu} -o $BWA_BAM Run picard SortSam on the BWA-aligned BAM file. picard SortSam I=$BWA_BAM \ # Input BAM. O=$BWASORTED_BAM \ # Coordinate-sorted BAM. SO="coordinate" \ # Specify the output should be coordinate-sorted CREATE_INDEX=false \ # Explicitly do not create an index at this step, in case the default changes. CREATE_MD5_FILE=false \ # Explicitly do not create an md5 checksum at this step, in case the default changes. COMPRESSION_LEVEL=5 \ # Explicitly set the compression level to 5, although, at the time of writing, this is the default. VALIDATION_STRINGENCY=SILENT # Turn off validation stringency for this step. Index the coordinate-sorted BAM file. samtools index $BWA_SORTED_BAM # BWA-aligned, coordinate-sorted BAM. Run picard ValidateSamFile on the aligned and sorted BAM file. picard ValidateSamFile I=$BWA_SORTED_BAM \ # BWA-aligned, coordinate-sorted BAM. IGNORE=INVALID_PLATFORM_VALUE \ # Validations to ignore. IGNORE=MISSING_PLATFORM_VALUE Run picard MarkDuplicates on the BWA-aligned BAM file. picard MarkDuplicates I=$BWA_SORTED_BAM \ # Input BAM. O=$MARKED_BAM \ # Duplicate-marked output BAM. VALIDATION_STRINGENCY=SILENT \ # Turn of validation stringency for this step. CREATE_INDEX=false \ # Explicitly do not create an index at this step, in case the default changes. CREATE_MD5_FILE=false \ # Explicitly do not create an md5 checksum at this step, in case the default changes. COMPRESSION_LEVEL=5 \ # Explicitly set the compression level to 5, although, at the time of writing, this is the default. METRICS_FILE=$METRICS_FILE \ # Location for the metrics file produced by MarkDuplicates. Run bamCoverage to generate bigwig file. bamCoverage --bam ${MARKED_BAM} \ # Input BAM file --outFileName ${prefix}.bw \ # Output bigwig filename --outFileFormat bigwig \ # Set output format to bigwig --numberOfProcessors "max" # Utilize all available processors --extendReads ${fragment_length}
